INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 40011, 2, 125801, 0, "リリ", 24001, 321, 1, 1);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, 40011, 2, 126001, 0, "クリア", 24001, 322, 2, 1);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("んーと。\nこれ、あげる。\nはい", 1, 40011, 2, 126101, 0, "プレシア", 24001, 323, 3, 1);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 1, 40011, 2, 125801, 0, "リリ", 24001, 324, 4, 2);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 1, 40011, 2, 126001, 0, "クリア", 24001, 325, 5, 2);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("お兄。\nきてくれて、うれしい", 1, 40011, 2, 126101, 0, "プレシア", 24001, 326, 6, 2);
